import React from 'react';
import { Link } from 'react-router-dom';
import TitleSubtitle from '../Components/TitleSubtitle.jsx'; // Importez le composant TitleSubtitle
import CopyrightText from '../Components/CopyrightText.jsx'; // Importez le composant CopyrightText

function EncaisserPage() {
  return (
    <div>
      {/* Titre et sous-titre */}
      <TitleSubtitle title="Encaisser" subtitle="les contribuables" />

      {/* Champ de saisie pour le matricule */}
      <div>
        <input type="text" placeholder="Matricule" />
      </div>

      {/* Bouton "Encaisser" */}
      <div>
        <Link to="/effectuer-encaissement">
          <button>Encaisser</button>
        </Link>
      </div>

      {/* Autre contenu de la page "Encaisser" */}
      {/* Ajoutez ici le contenu suppl√©mentaire de la page "Encaisser" */}

      {/* Composant pour le droit d'auteur */}
      <CopyrightText />
    </div>
  );
}

export default EncaisserPage;
